import { useParams } from 'react-router-dom'

export default function PostDetail() {

const {id} = useParams()
console.log(id)

useEffect(()=>{
    const fetchPostDetail =async ()=>{
    const data = await fetch('128.0.0.1:8000/postDetail/:id' ,{
        method:"GET"
    })

    const res = await data.json()
    console.log(res)


}
fetchPostDetail()
} , [])



